Nuestro alumnado del tercer ciclo ha aprendido más sobre la cultura francesa y sus celebraciones… Y es que, si el día 2 de febrero, es un día importante para todos los tinerfeños, debido a que celebramos el día de nuestra patrona, la Virgen de Candelaria, ¡para los franceses también es un día importante! Y… ¿sabéis cómo lo celebran? ¡Os lo explicamos!

&nbsp;

En este día, es tradición que familias y grupos de amigos se reúnan en sus casas para cocinar crepes. Y como podéis observar, nuestros alumnos y alumnas son unos auténticos y buenísimos chefs. No queremos poneros los dientes largos, ¡pero es que tienen una pinta exquisita!

&nbsp;

A continuación, os dejamos un resumen de cómo lo ha celebrado nuestro alumnado. E, incluso, ¡algunos se han aventurado a mostraros la receta!

&nbsp;

À bientôt!
